import React from "react";
import Cards from "../Ui/Cards";

const CardListArm = () => {
    const armData = [
        {
            image: 'https://res.cloudinary.com/duxhiuugx/image/upload/v1684872003/gymA_txhmrr.jpg',            
            title: 'Rutina de Brazos (Biceps y Triceps)',
            description: 'GymTopz'
        },
        {
            image: 'https://res.cloudinary.com/duxhiuugx/image/upload/v1684872003/gymA_txhmrr.jpg',            
            title: 'Rutina de Brazos Explosivos',
            description: 'GymTopz'
        },
        {
            image: 'https://res.cloudinary.com/duxhiuugx/image/upload/v1684872003/gymA_txhmrr.jpg',            
            title: 'Rutina de Brazos con Pesos',
            description: 'gymvirtual'
        },
        {
            image: 'https://res.cloudinary.com/duxhiuugx/image/upload/v1684872003/gymA_txhmrr.jpg',            
            title: 'Rutinas de Brazos sin Pesas',
            description: 'Entrena con Sergio Peinado'
        }
    ]

    return (
        <div className="card-list">
            {armData.map((cardDataarm, index) => (
                <Cards
                    key={index}
                    image={cardDataarm.image}
                    title={cardDataarm.title}
                    description={cardDataarm.description}
                />
            ))}
        </div>
    )
}

export default CardListArm;
